import React, {useState, useEffect } from 'react'
import axios from 'axios';

const Code = () => {
    const [data,setData] = useState([])
    useEffect(()=>{
        try{
            axios.get("https://dummyjson.com/todos").then((Response)=>{
                console.log(Response.data.todos);
                setData(Response.data.todos);
                
            })
        }catch(error){
            console.log(error);
            
        }

    },[])
  return (
    <>
    <table>
        <thead>
            <th>User</th>

        </thead>
    </table>
    </>
  )
}

export default Code
